I want to say its been 179 days since I started working from home and well minus six daysish since a global pandemic was declared.

I don't know if it's just me or if everyone else who went from commuting to work to rolling off the bed and making their way to their "office" feels like they haven't accomplished much during this madness- as if they could do more or should do more.

I was kicking myself for a bit about this and kept asking myself if I was doing this quarantine business wrong. In the midst of this unnecessary self-assured anxiety I decided to write down everything I've done, felt I've accomplished or learned during quarantine no matter how big or small. 

For example, finally able to bend and touch my toes! It may seem dumb but anyone who knows me knows I am far from flexible. Finishing 30 straight days of yoga (which is why I can touch my toes now!) Learning to bake a copycat version of my favorite oatmeal raisin cookie. Getting behind a sewing machine for the first time and then raising money for two charities because i do not underetsnd  measurements. Cooked a perfect fried egg. And so on.

While I may not be doing it right, I'm not doing it wrong either, or at least I don't think anymore. 

Anywho, what's on your list of quarantine accomplishmens? Big, small, medium, somewhere in the middle. Let me have it.";}i:147;a:1:{s:14:"comments_count";i:1;}i:148;a:1:{s:11:"likes_count";i:11;}i:149;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvJiTchm1F";}i:150;a:1:{s:5:"image";s:239:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118712388_4183476348389932_7991144012269904388_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=104&_nc_ohc=G6w1C5smbOMAX9pdLrB&oh=af2f6c74a9733cc731717d1901fb5665&oe=5F7CA5A2";}i:151;a:1:{s:4:"type";s:5:"image";}i:152;a:1:{s:8:"owner_id";i:35890567;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391169801969730622";}i:157;a:1:{s:10:"short_code";s:11:"CEvJEQUDAQ-";}i:158;a:1:{s:12:"created_time";i:1599269675;}i:159;a:1:{s:7:"caption";s:158:"6 years. Still got it with @mmccarty1 (And additional photo bombers.)
